import '../menu-items/menu-items.scss';


function MenuItem(props){
    return (
    <div className>
        <div className="content" >
            <h1 className="tittle">{props.title}</h1>
            <span className="subtittle">SHOP NOW</span>
        </div>
    </div>
    )
}

export default MenuItem;
